import { Component } from "react";

let styles = {
	h4: {
		color: 'red'
	}
}

class Stock extends Component {
	
	render(){
		const { bikes } = this.props
		return(
			<div style={styles.h4}>
				{bikes.map(element=>element.stock-1)}
			</div>
		)
	}
}



export default Stock
